INSERT INTO `sy_admin_action_log` VALUES ('96', '1', 'POST', 'sytechadmin/news/news_edit.html', '59.33.64.67', 'a:2:{s:3:\"get\";a:0:{}s:4:\"post\";a:12:{s:6:\"typeid\";s:1:\"3\";s:5:\"title\";s:24:\"万合医疗服务协议\";s:5:\"place\";s:0:\"\";s:5:\"brief\";s:0:\"\";s:3:\"img\";s:0:\"\";s:7:\"linkurl\";s:0:\"\";s:7:\"content\";s:6599:\"&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;一、一般声明&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;p&gt;1. 本声明适用于注册或使用&amp;ldquo;万合医疗&amp;rdquo;旗下的&amp;ldquo;万合医疗&amp;rdquo;网站、 &amp;ldquo;万合医疗&amp;rdquo;微信公众号（vipmedcare）、&amp;ldquo;万合医疗&amp;rdquo;APP以及&amp;ldquo;万合医疗&amp;rdquo;将来开发的互联网及自媒体等系列电子数据平台（下称本平台）的病人用户。&amp;ldquo;万合医疗&amp;ldquo;的商标所有人为广州万合医疗技术有限公司（下称本平台）。&lt;/p&gt;\n&lt;p&gt;2.本服务协议仅为本平台为注册用户提供医疗信息的协议，平台用户医患双方的线下面诊、转诊属于自主行为，与本平台无关，注册用户对此表示清楚。&lt;/p&gt;\n&lt;p&gt;3.当您注册或使用&amp;ldquo;万合医疗&amp;rdquo;旗下网站、APP、微信公众号等时，表明您已知晓并同意本声明的内容，这些内容自动成为您与本平台协议的一部分。&lt;/p&gt;\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;二、注册及使用声明&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;p&gt;1. &amp;ldquo;万合医疗&amp;rdquo;的病人用户应先注册登录，方可提交就诊求助等信息。&lt;/p&gt;\n&lt;p&gt;2. 您注册本网站所提供的信息应当真实有效，不得盗用他人账号，不得提供虚假信息，如经本平台查实您盗用他人账号或提供虚假信息，本平台有权屏蔽或注销该用户。&lt;/p&gt;\n&lt;p&gt;3. 您的用户名和昵称的注册与使用应符合网络道德，遵守中华人民共和国的相关法律法规，不得含有威胁、淫秽、谩骂、非法、侵害他人权益等有争议性的文字。如因违反上述规范而影响您的注册和使用，本平台不承担责任。&lt;/p&gt;\n&lt;p&gt;4. 当您注册成功后，您必须保护好自己的账号和密码。如因用户本人泄露而造成的任何损失，本平台不承担责任。&lt;/p&gt;\n&lt;p&gt;5. 因您注册或使用本平台而产生的个人信息，将为本平台所知晓，您授权本平台因服务于您的目的而使用这些个人信息，包括但不限于向您发出服务请求、服务信息等。&lt;/p&gt;\n&lt;p&gt;6. 若非本平台注册或使用所明示需要，请您慎重并避免发出带有个人电话、QQ、微信、电子邮箱等联系方式的内容，由此出现被扰或其他伤害行为责任自负。&lt;/p&gt;\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;三、关于本平台&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;p&gt;1. 本平台的用户包括医、患双方，本平台主要为医患双方沟通交流、尤其是预约手术提供方便，本平台没有资质也没有能力就特定病人的特定疾病提供任何形式的医疗服务，医患双方经本平台而产生的咨询、转诊、诊疗等行为系医患之间独立决定，本平台不参与、不干预，因咨询、转诊或诊疗等而产生的医疗损害或其他争议，与本平台无关，医患任何一方不得向本平台主张责任。&lt;/p&gt;\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;p&gt;2. 应用户的请求，本平台可能推荐相关医生、医疗机构或提出诊疗科室的建议，但这些推荐或建议仅具有参考价值，是否接受由用户自行决定。用户承诺，不因平台的此项推荐或建议而追究本平台的责任，也不因用户的直接指定转诊医生而追究本平台的责任。&lt;/p&gt;\n&lt;p&gt;3. 本平台的用户知晓且同意，因使用本平台的医疗帮助功能而产生的病历资料、咨询内容、医生建议等，在去掉个人隐私的信息后，可以在本平台公开展示。但如果用户提出特别请求，本平台应根据用户请求将相关病历、咨询或建议等设置为隐私。&lt;/p&gt;\n&lt;p&gt;4. 本平台承诺：除非事先得到用户的许可，不会向第三方出售或借用用户的个人信息以及包含个人信息的疾病资料、咨询建议等信息；非经司法程序或用户的许可，不会向第三方泄露您的个人信息，如姓名、身份证号码、肖像、邮箱、地址、QQ号、个人微信号等以及包含个人信息的疾病资料、咨询建议等信息。&lt;/p&gt;\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;p&gt;&lt;strong&gt;四、关于病人&lt;/strong&gt;&lt;/p&gt;\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n&lt;p&gt;1. 本平台主要是为有医疗帮助需求的患者提供预约医生的服务。因此如果您是一名患者，打算通过本平台预约医生的服务时，请首先考虑您的看病需求。本平台强烈建议，您应先到就近医院首诊，有初步诊断后，再考虑是否通过本平台预约进一步的诊疗。&lt;/p&gt;\n&lt;p&gt;2. 当您决定通过本平台预约医生时，如果需要提交首诊时的病历，请您按时间、先门诊后住院病历的顺序拍照后依次提交，以便医生阅读，请确保照片清晰。影像学片子，可拍摄或扫描后直接提交。&lt;/p&gt;\n&lt;p&gt;3. 当您通过本平台预约医生成功后，意味着您成为了本平台的用户，将自愿遵守本平台的规则，并服从本平台的统一管理。&lt;/p&gt;\n&lt;p&gt;4. 当您通过本平台预约医生成功后，接待您的医生是在本平台上已注册并开通接诊服务的医生，他可能为您安排一次线下门诊。此线下门诊是医生所在医院正常门诊外的加号服务。当您获得接诊服务后，如需要进一步预约住院或手术服务，可通过接诊医生预约，也可直接向本平台发起预约服务的请求。&lt;/p&gt;\n&lt;p&gt;5. 作为病人，您知晓且同意，通过本平台，医生将为您提供的咨询建议及延伸到线下的包括但不仅限于门诊、住院及手术的医疗服务，均系医生与您之间的独立行为，无论是医疗行为的具体内容还是医疗费用的收取，本平台不参与、不干预。本平台不能保证疗效，对可能发生的诊疗效果、医疗损害活医疗费用争议，您不应当向本平台提出主张。&lt;/p&gt;\n&lt;p&gt;6. 当您通过平台预约了专家的面诊或手术服务后，意味着平台已经启动相应的资源来对接专家，专家已知晓您的情况并为了您的需求而进行了时间、资源、精力上等等付出。如您在过程中做出爽约行为，会对专家造成一定的损失，平台将根据违约情况扣除相应的违约金，敬请知悉。&lt;/p&gt;\";s:7:\"isindex\";s:1:\"1\";s:8:\"ispublic\";s:1:\"1\";s:12:\"publish_time\";s:19:\"2021-02-04 09:50:20\";s:6:\"sortby\";s:1:\"0\";s:6:\"newsid\";s:1:\"5\";}}', '2021-02-04 10:39:08');
