INSERT INTO `sy_admin_action_log` VALUES ('122', '1', 'POST', 'sytechadmin/basedoctors/basedoctors_edit.html', '59.33.64.67', 'a:2:{s:3:\"get\";a:0:{}s:4:\"post\";a:9:{s:11:\"hospital_id\";s:1:\"1\";s:13:\"department_id\";s:1:\"2\";s:8:\"realname\";s:13:\"基层医生1\";s:6:\"mobile\";s:11:\"15327461193\";s:19:\"professional_titles\";s:27:\"泌尿外科副主任医师\";s:6:\"labels\";s:0:\"\";s:7:\"content\";s:702:\"毕业于南方医科大学，一直从事泌尿外科工作。曾于广州医科大学微创中心及南方医科大学珠江医院进修学习，对泌尿外科疾病的诊断及微创治疗拥有丰富的临床经验，在我院率先开展泌尿外科微创手术，带领我科跨入微创时代，开展的手术包括经尿道前列腺剜除术，经皮肾镜碎石取石术，输尿管镜碎石取石术，腹腔镜肾上腺肿瘤切除术，腹腔镜输尿管切开取石术，腹腔镜肾癌根治术，腹腔镜前列腺癌根治术，腹腔镜膀胱部分切除术，经尿道膀胱肿瘤根治性电切术等等。拥有科研立项一项，发表有国家级及核心期刊论文多篇。\";s:6:\"status\";s:1:\"1\";s:13:\"basedoctorsid\";s:1:\"2\";}}', '2021-02-04 10:52:36');
