INSERT INTO `sy_basedoctor` VALUES ('1', '7', 'o8mUb5hGuFrKXsJUTDotir3piJCM', '1234', '基层医生2', '13800138009', '1', '2', '副主任医师', '从业10年', '毕业于南方医科大学，一直从事泌尿外科工作。曾于广州医科大学微创中心及南方医科大学珠江医院进修学习，对泌尿外科疾病的诊断及微创治疗拥有丰富的临床经验，在我院率先开展泌尿外科微创手术，带领我科跨入微创时代，开展的手术包括经尿道前列腺剜除术，经皮肾镜碎石取石术，输尿管镜碎石取石术，腹腔镜肾上腺肿瘤切除术，腹腔镜输尿管切开取石术，腹腔镜肾癌根治术，腹腔镜前列腺癌根治术，腹腔镜膀胱部分切除术，经尿道膀胱肿瘤根治性电切术等等。拥有科研立项一项，发表有国家级及核心期刊论文多篇。', '/upload/qrcode/20210204/601b61f4bc9ec.png', '', '/upload/attach/2021/02-04/052976afd14f5372a6db1c06dafd8de8.jpg', '0', '2', '1', null, null, '2021-02-05 14:33:13');
INSERT INTO `sy_basedoctor` VALUES ('2', '0', '', '1598936', '基层医生1', '15327461193', '1', '2', '泌尿外科副主任医师', '', '毕业于南方医科大学，一直从事泌尿外科工作。曾于广州医科大学微创中心及南方医科大学珠江医院进修学习，对泌尿外科疾病的诊断及微创治疗拥有丰富的临床经验，在我院率先开展泌尿外科微创手术，带领我科跨入微创时代，开展的手术包括经尿道前列腺剜除术，经皮肾镜碎石取石术，输尿管镜碎石取石术，腹腔镜肾上腺肿瘤切除术，腹腔镜输尿管切开取石术，腹腔镜肾癌根治术，腹腔镜前列腺癌根治术，腹腔镜膀胱部分切除术，经尿道膀胱肿瘤根治性电切术等等。拥有科研立项一项，发表有国家级及核心期刊论文多篇。', '/upload/qrcode/20210303/603f52f6ca340.png', '', '/upload/attach/2021/02-04/3b205f5774dbd751fda9e046ef64359d.jpg', '0', '2', '1', null, null, '2021-03-03 17:12:22');
INSERT INTO `sy_basedoctor` VALUES ('3', '0', '', '71865274', 'df', '13813813888', '1', '2', 'df', 'ff', '', '/upload/qrcode/20210303/603f533fd86c5.png', '', '', '0', '2', '1', null, '2021-03-03 17:13:35', null);
INSERT INTO `sy_doctor` VALUES ('1', '0', '123456', '李小四', '13800138001', '/upload/attach/2021/02-04/f84512976221ab944983e9adcf7fc659.jpg', '5', '3', '副主任医师', '副主任医师|从业10年', '<p>名医</p>', '神经外科|开颅手术', '国际认可专家', '中山市博爱医院', '80', '40', '40', '0', '0', '1', '2021-02-05 09:07:15', '1', '2021-02-05 09:07:15', '李小四南方医科大学南方医院重症医学科神经外科|开颅手|外科手术副主任医师|从业10年副主任医师', '2', '98', null, '2021-02-23 17:05:22');
INSERT INTO `sy_doctor` VALUES ('2', '0', '', '张大山', '13813813888', '/upload/attach/2021/02-04/5cfb9457c65e3c81289b616ee8c42dcb.jpg', '1', '2', '主任医师', '主任医师|从业15年', '<p><strong>【学术头衔】</strong></p>\n<p>1、国际外科学会委员</p>\n<p>2、中国医师协会外科分会委员</p>\n<p><strong>【教育经历】</strong></p>\n<p>1、本科毕业于华西医科大学，硕士、博士就读于同济医科大学。</p>\n<p><strong>【专业事迹】</strong></p>\n<p>曾在国际学术会议进行手术演示。</p>', '神经外科|开颅手术', '中国名医外科TOP10|国际认可专家', '广东省人民医院|广东省人民医院2', '110', '110', '0', '0', '0', '1', '2021-02-05 14:43:32', '1', '2021-02-05 14:43:32', '张大山广东省人民医院心血管外科神经外科|开颅手术主任医师|从业15年主任医师', '2', '99', null, '2021-02-23 16:03:09');
