INSERT INTO `sy_news` VALUES ('5', '3', '万合医疗服务协议', null, '', '', '<p>&nbsp;</p>\n<p><strong>一、一般声明</strong></p>\n<p>&nbsp;</p>\n<p>1. 本声明适用于注册或使用&ldquo;万合医疗&rdquo;旗下的&ldquo;万合医疗&rdquo;网站、 &ldquo;万合医疗&rdquo;微信公众号（vipmedcare）、&ldquo;万合医疗&rdquo;APP以及&ldquo;万合医疗&rdquo;将来开发的互联网及自媒体等系列电子数据平台（下称本平台）的病人用户。&ldquo;万合医疗&ldquo;的商标所有人为广州万合医疗技术有限公司（下称本平台）。</p>\n<p>2.本服务协议仅为本平台为注册用户提供医疗信息的协议，平台用户医患双方的线下面诊、转诊属于自主行为，与本平台无关，注册用户对此表示清楚。</p>\n<p>3.当您注册或使用&ldquo;万合医疗&rdquo;旗下网站、APP、微信公众号等时，表明您已知晓并同意本声明的内容，这些内容自动成为您与本平台协议的一部分。</p>\n<p>&nbsp;</p>\n<p><strong>二、注册及使用声明</strong></p>\n<p>&nbsp;</p>\n<p>1. &ldquo;万合医疗&rdquo;的病人用户应先注册登录，方可提交就诊求助等信息。</p>\n<p>2. 您注册本网站所提供的信息应当真实有效，不得盗用他人账号，不得提供虚假信息，如经本平台查实您盗用他人账号或提供虚假信息，本平台有权屏蔽或注销该用户。</p>\n<p>3. 您的用户名和昵称的注册与使用应符合网络道德，遵守中华人民共和国的相关法律法规，不得含有威胁、淫秽、谩骂、非法、侵害他人权益等有争议性的文字。如因违反上述规范而影响您的注册和使用，本平台不承担责任。</p>\n<p>4. 当您注册成功后，您必须保护好自己的账号和密码。如因用户本人泄露而造成的任何损失，本平台不承担责任。</p>\n<p>5. 因您注册或使用本平台而产生的个人信息，将为本平台所知晓，您授权本平台因服务于您的目的而使用这些个人信息，包括但不限于向您发出服务请求、服务信息等。</p>\n<p>6. 若非本平台注册或使用所明示需要，请您慎重并避免发出带有个人电话、QQ、微信、电子邮箱等联系方式的内容，由此出现被扰或其他伤害行为责任自负。</p>\n<p>&nbsp;</p>\n<p><strong>三、关于本平台</strong></p>\n<p>&nbsp;</p>\n<p>1. 本平台的用户包括医、患双方，本平台主要为医患双方沟通交流、尤其是预约手术提供方便，本平台没有资质也没有能力就特定病人的特定疾病提供任何形式的医疗服务，医患双方经本平台而产生的咨询、转诊、诊疗等行为系医患之间独立决定，本平台不参与、不干预，因咨询、转诊或诊疗等而产生的医疗损害或其他争议，与本平台无关，医患任何一方不得向本平台主张责任。</p>\n<p>&nbsp;</p>\n<p>2. 应用户的请求，本平台可能推荐相关医生、医疗机构或提出诊疗科室的建议，但这些推荐或建议仅具有参考价值，是否接受由用户自行决定。用户承诺，不因平台的此项推荐或建议而追究本平台的责任，也不因用户的直接指定转诊医生而追究本平台的责任。</p>\n<p>3. 本平台的用户知晓且同意，因使用本平台的医疗帮助功能而产生的病历资料、咨询内容、医生建议等，在去掉个人隐私的信息后，可以在本平台公开展示。但如果用户提出特别请求，本平台应根据用户请求将相关病历、咨询或建议等设置为隐私。</p>\n<p>4. 本平台承诺：除非事先得到用户的许可，不会向第三方出售或借用用户的个人信息以及包含个人信息的疾病资料、咨询建议等信息；非经司法程序或用户的许可，不会向第三方泄露您的个人信息，如姓名、身份证号码、肖像、邮箱、地址、QQ号、个人微信号等以及包含个人信息的疾病资料、咨询建议等信息。</p>\n<p>&nbsp;</p>\n<p><strong>四、关于病人</strong></p>\n<p>&nbsp;</p>\n<p>1. 本平台主要是为有医疗帮助需求的患者提供预约医生的服务。因此如果您是一名患者，打算通过本平台预约医生的服务时，请首先考虑您的看病需求。本平台强烈建议，您应先到就近医院首诊，有初步诊断后，再考虑是否通过本平台预约进一步的诊疗。</p>\n<p>2. 当您决定通过本平台预约医生时，如果需要提交首诊时的病历，请您按时间、先门诊后住院病历的顺序拍照后依次提交，以便医生阅读，请确保照片清晰。影像学片子，可拍摄或扫描后直接提交。</p>\n<p>3. 当您通过本平台预约医生成功后，意味着您成为了本平台的用户，将自愿遵守本平台的规则，并服从本平台的统一管理。</p>\n<p>4. 当您通过本平台预约医生成功后，接待您的医生是在本平台上已注册并开通接诊服务的医生，他可能为您安排一次线下门诊。此线下门诊是医生所在医院正常门诊外的加号服务。当您获得接诊服务后，如需要进一步预约住院或手术服务，可通过接诊医生预约，也可直接向本平台发起预约服务的请求。</p>\n<p>5. 作为病人，您知晓且同意，通过本平台，医生将为您提供的咨询建议及延伸到线下的包括但不仅限于门诊、住院及手术的医疗服务，均系医生与您之间的独立行为，无论是医疗行为的具体内容还是医疗费用的收取，本平台不参与、不干预。本平台不能保证疗效，对可能发生的诊疗效果、医疗损害活医疗费用争议，您不应当向本平台提出主张。</p>\n<p>6. 当您通过平台预约了专家的面诊或手术服务后，意味着平台已经启动相应的资源来对接专家，专家已知晓您的情况并为了您的需求而进行了时间、资源、精力上等等付出。如您在过程中做出爽约行为，会对专家造成一定的损失，平台将根据违约情况扣除相应的违约金，敬请知悉。</p>', '', '2', '2021-02-04 10:39:08', '1', '2021-02-04 09:50:20', '', '0', '2021-02-04 09:50:20', '2021-02-04 10:39:16');
INSERT INTO `sy_news` VALUES ('6', '2', '广东省人民医院', '/upload/attach/2021/02-04/27f729a248752656a153aa6b86044429.jpg', '', '', '<p><span style=\"font-family: simsun, serif; font-size: 16px;\">&nbsp; &nbsp; 广东省人民医院（广东省医学科学院）创建于1946年，综合实力名列国内前茅，病人来源覆盖国内外，深受广大群众信赖。2008年，广东省医学科学院恢复挂牌，与广东省人民医院合署办公。2014年，与华南理工大学签约合作共建华南理工大学医学院和华南理工大学第一临床学院。2017年，挂牌&ldquo;华南理工大学附属广东省人民医院&rdquo;</span></p>\n<p><span style=\"font-family: simsun, serif; font-size: 16px;\">&nbsp; &nbsp; 医院各专科亚专科设置齐全，共有12个国家临床重点专科、30个广东省临床医学重点专科/学科。我院2018年度全国最佳医院排行榜（复旦版）综合排名第27名，位居全国省级人民医院前列；排名进入全国前十的专科共5个：心外科（第4名）、心血管病（第4名）、老年医学（第6名）、急诊医学（第8名）、放射科（第9名）。我院自1998年以来共完成159例心脏移植，并在国际上首次成功开展产时胎儿心脏外科手术、国内首次成功开展胎儿心脏介入治疗。长期承担干部保健工作，是华南地区最重要的老年医学研究和干部保健基地。</span></p>\n<p><span style=\"font-family: simsun, serif; font-size: 16px;\">&nbsp; &nbsp; 医院整体科研实力雄厚，标志性科研项目成绩斐然。&ldquo;十二五&rdquo;以来，获得国家科技进步二等奖1项、省科学技术奖18项、中华医学科技奖一等奖1项、2015-2019期间获授权专利135项，承担国家和省级科研项目750项，获得国家重点研发计划重点专项10项、课题20项，发表SCI论文1831篇，总IF值6638.584分。拥有5所广东省重点实验室，2006年起承担临床试验项目896项，2019年新获科研项目资助总额达7581万元。</span></p>\n<p><span style=\"font-family: simsun, serif; font-size: 16px;\">&nbsp; &nbsp; 作为广东省高等医学院校教学医院，承担了华南理工大学、南方医科大学、中山大学、汕头大学等多所院校理论教学和实习带教任务。是广东省内最早开展住院医师和全科医师规范化培训的培训基地之一，有国家住院医师规范化培训专业基地27个。现有专科医师培训试点基地7个，包括心血管病学、呼吸与危重症医学、内科老年医学、普通外科学、内科危重症医学、外科危重症医学、新生儿围产期医学。近五年获批立项的国家级继续医学教育项目284项，近五年面向基层医院开展适宜技术推广项目23项。</span></p>\n<p><span style=\"font-family: simsun, serif; font-size: 16px;\">&nbsp; &nbsp; 医院对外交流与合作非常活跃，先后与美国克利夫兰诊所、梅奥诊所、麻省总医院、以及加拿大、澳大利亚、以色列、丹麦等多个国家和地区的著名医疗机构建立了学术交流与科研合作关系。</span></p>\n<p><span style=\"font-family: simsun, serif; font-size: 16px;\">&nbsp; &nbsp; 目前，我院有教育部&ldquo;长江学者&rdquo;特聘教授称号1人、国家杰出青年基金获得者2人、国家&ldquo;百千万工程&rdquo;有突出贡献中青年专家3人、教育部跨世纪优秀人才1人、国家卫生计生突出贡献中青年专家4人、享受国务院政府特殊津贴人员33人。任职国家级学会及下属二级机构领导职务43人次。现有博士生导师73人、硕士生导师200人，近5年为国家培养了博士、硕士研究生1126人。</span></p>\n<p><span style=\"font-family: simsun, serif; font-size: 16px;\">&nbsp; &nbsp; 通过质量立院、科技兴院、人才强院、文化昌院，朝着&ldquo;全国一流、世界知名&rdquo;的目标扬帆远航。</span></p>', '', '1', '2021-02-04 10:45:19', '1', '2021-02-04 10:42:52', '广州市中山二路106号', '0', '2021-02-04 10:42:52', '2021-02-04 10:45:19');
INSERT INTO `sy_news` VALUES ('7', '1', '癌症病人放疗后不注意这点，后续可能有难以忍受的痛苦！', '/upload/attach/2021/02-04/bbb4f7d273e55d5aa75ffb2c78eac612.png', '', '放射性肠炎的症状', '', 'https://mp.weixin.qq.com/s/CmiaDCQGJQBkaUisRm3NEQ', '1', '2021-02-04 12:03:05', '1', '2021-02-04 10:48:55', '', '0', '2021-02-04 10:48:55', '2021-02-04 12:03:05');
INSERT INTO `sy_news` VALUES ('10', '1', '悄悄变成肝硬化、肝癌，它比乙肝还可怕！很多人感染了却不知道', '/upload/attach/2021/02-04/19675225ef931fb81c553788aafbc58b.png', '', '', '<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">丙肝</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">我们国家是个肝炎大国大家最熟悉的就是可怕的乙肝而对于另一个</span>&ldquo;<span style=\"font-family: 宋体;\">沉默杀手</span>&rdquo;&mdash;&mdash;<span style=\"font-family: 宋体;\">丙肝很多人都不了解也不重视它的杀伤力可不比乙肝小今天我们就来好好聊聊</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">什么是丙肝？</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">丙型病毒性肝炎，简称为丙型肝炎、丙肝，是一种由丙型肝炎病毒（</span>HCV<span style=\"font-family: 宋体;\">）感染引起的病毒性肝炎。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">丙肝患者并不少，但由于丙型肝炎患者症状隐匿，因此在人群中存在较多的隐匿传染源。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">丙肝感染后肝硬化和肝癌的发生率比乙肝感染还高哦！而且它还是不知不觉地在干坏事！</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">丙肝是如何传播的？</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">主要经血液传播、性传播、母婴传播，日常生活中共用剃须刀、牙刷、纹身和穿耳环孔等也是丙肝潜在的传播方式。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">接吻、拥抱、喷嚏、咳嗽、食物、饮水、共用餐具和水杯、无皮肤破损及其他无血液暴露的接触，一般不会传播。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">哪些人群需要筛查丙肝？</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">虽然听起来可怕，目前也还没有丙型肝炎疫苗问世，但它仍属于可防可治的疾病，是可以治愈的。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">及时检查和治疗能够大大增加康复的可能，防止进一步发展为肝硬化或肝癌。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">在医院进行有创操作前一般都会检查丙肝抗体，除此之外，如您符合以下情况，建议及时接受丙肝筛查：</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">有输血史、应用血液制品史，特别是</span>1993<span style=\"font-family: 宋体;\">年前有输血或应用血制品者；</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">曾经或正在注射毒品者，包括仅注射</span>1<span style=\"font-family: 宋体;\">次而不认为自己是药瘾者；</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">接受实体器官移植者或捐献实体器官或血液，包括血液成分捐献者，未进行过丙型肝炎筛查者；</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">丙型肝炎患者的性伴侣或与其有共用牙刷、剃须刀、指甲刀等的家庭成员；</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">有破损皮肤、黏膜被</span>HCV<span style=\"font-family: 宋体;\">感染者伤口的血、血迹、棉球或其他用具等污染者；</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">HIV<span style=\"font-family: 宋体;\">感染者、</span>HIV<span style=\"font-family: 宋体;\">阳性的伴侣，男性同性恋和有多个性伴侣者；</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">有应用不安全针刺疗法、刺纹身、皮肤穿孔史者；</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">不明原因转氨酶升高者。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">如何确诊丙肝？</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><br /><br /></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">丙肝抗体阴性，代表无感染；</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">丙肝抗体阳性，需要结合丙肝核酸（</span>HCVRNA<span style=\"font-family: 宋体;\">）检测。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">若丙肝抗体阳性，</span>HCVRNA<span style=\"font-family: 宋体;\">结果为阴性，代表您既往有丙肝感染，建议随访；</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">若丙肝抗体阳性，且</span>HCVRNA<span style=\"font-family: 宋体;\">结果也为阳性，那确诊为丙肝，需要进行抗病毒治疗。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">朱女士的丙肝抗体是阳性。我们对她进行了</span>HCVRNA<span style=\"font-family: 宋体;\">检测，结果也是阳性的。因此她需要进行抗病毒治疗。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">抗病毒治疗是怎么进行的？</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">抗病毒治疗前，医生会根据病情与您商量具体的药物治疗方案。治疗疗程一般均为</span>3<span style=\"font-family: 宋体;\">个月，治愈率可达</span>95%<span style=\"font-family: 宋体;\">以上。治疗药物都是进入医保的。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">朱女士进行了</span>3<span style=\"font-family: 宋体;\">个月的一天一片的抗病毒药物治疗，停药后</span>3<span style=\"font-family: 宋体;\">月复查丙肝核酸为阴性，停药后一年复查结果也是阴性的，这代表她的丙肝治愈了。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: 宋体;\">所以，我们再次提醒大家，丙肝不及时治疗会偷偷伤害肝脏，可造成肝硬化或肝癌。但它是一种可防、可控、可治的疾病，高危人群建议进行丙肝抗体的筛查。而一般人群，一生也至少进行一次丙肝抗体的检查。</span></p>\n<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; font-size: 10.5pt; font-family: Calibri, sans-serif;\">&nbsp;</p>', '', '1', '2021-02-04 12:02:56', '1', '2021-02-04 10:50:24', '', '0', '2021-02-04 10:50:24', '2021-02-04 12:02:56');
