DROP TABLE IF EXISTS `sy_doctor`;
CREATE TABLE `sy_doctor` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT '0' COMMENT '用户id user表id',
  `openid` varchar(100) DEFAULT '' COMMENT '小程序id 和用户表的一样',
  `realname` varchar(50) DEFAULT '' COMMENT '真实姓名',
  `mobile` varchar(30) DEFAULT '' COMMENT '联系电话',
  `avatar` varchar(255) DEFAULT '' COMMENT '头像',
  `hospital_id` int(11) DEFAULT '0' COMMENT '所属医院id',
  `department_id` int(11) DEFAULT '0' COMMENT '所属科室',
  `professional_titles` varchar(1000) DEFAULT '' COMMENT '职称',
  `labels` varchar(1000) DEFAULT '' COMMENT '自定义标签',
  `content` text COMMENT '简介',
  `skill` text COMMENT '专业擅长',
  `honorlist` longtext COMMENT '荣誉墙',
  `place` text COMMENT '执业地点',
  `integral_all` int(11) DEFAULT '0' COMMENT '总积分',
  `integral_able` int(11) DEFAULT '0' COMMENT '可用积分',
  `integral_use` int(11) DEFAULT '0' COMMENT '已提现',
  `meetnum` int(11) DEFAULT '0' COMMENT '预约次数',
  `visit_rate` varchar(20) DEFAULT '0' COMMENT '复诊率',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态 1正常 2禁用',
  `status_time` datetime DEFAULT NULL COMMENT '禁用时间',
  `isindex` tinyint(1) DEFAULT '2' COMMENT '是否显示在首页 1是 2否',
  `index_time` datetime DEFAULT NULL COMMENT '设置首页显示的时间',
  `search_word` varchar(1000) DEFAULT NULL,
  `isdel` tinyint(1) DEFAULT '2' COMMENT '是否删除 1是 2否',
  `sortby` int(11) DEFAULT '0' COMMENT '排序',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COMMENT='名医';

