DROP TABLE IF EXISTS `sy_news`;
CREATE TABLE `sy_news` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `typeid` smallint(5) DEFAULT '0' COMMENT '类型id',
  `title` varchar(255) DEFAULT '' COMMENT '标题',
  `img` varchar(255) DEFAULT NULL,
