-- ----------------------------
-- Table structure for sy_orders
-- ----------------------------
DROP TABLE IF EXISTS `sy_orders`;
CREATE TABLE `sy_orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT '0' COMMENT '用户id',
  `assistant_id` int(11) DEFAULT '0' COMMENT '名医助理id',
  `basedoctor_id` int(11) DEFAULT '0' COMMENT '基层医生id',
  `doctor_id` int(11) DEFAULT '0' COMMENT '名医id',
  `orderno` varchar(60) DEFAULT '' COMMENT '订单号',
  `payno` varchar(60) DEFAULT '' COMMENT '自定义支付单号',
  `realname` varchar(50) DEFAULT '' COMMENT '就诊人姓名',
  `mobile` varchar(30) DEFAULT '' COMMENT '就诊人联系电话',
  `content` text COMMENT '诊断信息',
  `status` tinyint(1) DEFAULT '1' COMMENT '状态 1待处理 2已预约 3已完成 4退款中 5已关闭',
  `deal_time` datetime DEFAULT NULL COMMENT '助理处理时间',
  `finish_time` datetime DEFAULT NULL COMMENT '完成时间',
  `doctor_integral` varchar(30) DEFAULT '0' COMMENT '医生所得积分',
  `basedoctor_integral` varchar(30) DEFAULT '0' COMMENT '基层医生所得积分',
  `assistant_integral` varchar(30) DEFAULT '0' COMMENT '名医助理所得积分',
  `issettle` tinyint(1) DEFAULT '2' COMMENT '是否结算 1是 2否',
  `settle_time` datetime DEFAULT NULL COMMENT '结算时间',
  `meeting_time` datetime DEFAULT NULL COMMENT '预约时间',
  `meetingymd` varchar(30) DEFAULT '',
  `money` int(11) DEFAULT '0' COMMENT '应付金额 单位分',
  `discount_money` int(11) DEFAULT '0' COMMENT '优惠金额',
  `pay_money` int(11) DEFAULT '0' COMMENT '支付金额',
  `ispay` tinyint(1) DEFAULT '2' COMMENT '是否支付 1是 2否 3支付失败',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `pay_way` tinyint(1) DEFAULT '1' COMMENT '支付方式 1微信 2支付宝',
  `pay_tradeno` varchar(100) DEFAULT NULL COMMENT '支付流水号(微信或者支付宝)',
  `isrefund` tinyint(1) DEFAULT '2' COMMENT '是否有退款 1是 2否',
  `refund_money` int(11) DEFAULT '0' COMMENT '退款金额',
  `refund_time` datetime DEFAULT NULL COMMENT '退款时间',
  `refund_item` text COMMENT '退款明细',
  `isfirst` tinyint(1) DEFAULT '2' COMMENT '是否首次预约 1是 2否',
  `close_time` datetime DEFAULT NULL COMMENT '关闭时间',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8mb4 COMMENT='预约订单表';

-- ----------------------------
-- Records of sy_orders
