  `roleid` int(11) DEFAULT '0' COMMENT '角色id 名医助理角色assistant表id，基层医生basedoctor表id，名医doctor表id',
  `basedoctor_id` int(11) DEFAULT '0' COMMENT '基层医生id',
  `bind_time` datetime DEFAULT NULL COMMENT '绑定时间',
  `bind_way` tinyint(1) DEFAULT '0' COMMENT '绑定方式 1注册绑定 2助理通过订单绑定',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `sex` varchar(10) DEFAULT '',
  `city` varchar(50) DEFAULT NULL,
  `province` varchar(50) DEFAULT '',
  `country` varchar(50) DEFAULT '',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COMMENT='用户表';

